import React from 'react';

function App() {
  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(to right, #667eea, #764ba2)',
      color: '#fff',
      fontFamily: 'Segoe UI, sans-serif',
      padding: '2rem',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center'
    }}>
      <div style={{
        backgroundColor: '#ffffff20',
        padding: '2rem',
        borderRadius: '1rem',
        width: '90%',
        maxWidth: '500px',
        boxShadow: '0 4px 15px rgba(0,0,0,0.2)',
        textAlign: 'center'
      }}>
        <h1 style={{ marginBottom: '1rem' }}>Welcome to React Native App</h1>
        <p style={{ fontSize: '1.1rem', marginBottom: '2rem' }}>
          This is a modern, clean UI built with React. You can use this as a landing screen or a dashboard start page.
        </p>
        <button style={{
          backgroundColor: '#fff',
          color: '#764ba2',
          padding: '0.75rem 1.5rem',
          border: 'none',
          borderRadius: '0.5rem',
          fontSize: '1rem',
          cursor: 'pointer',
          transition: 'all 0.3s ease'
        }}
        onMouseOver={(e) => e.target.style.backgroundColor = '#eee'}
        onMouseOut={(e) => e.target.style.backgroundColor = '#fff'}
        >
          Explore More
        </button>
      </div>
    </div>
  );
}

export default App;
